import React from 'react';
import NavBar from '../layout/Navbar'


const Contact = () => {
  return (
    <div><NavBar/>
    <div className="container" >
      <div className="py-4" classname="text-black blocktext">
      <div className="row mt-3">
          <div className="col text-center">
            <h2 className="mb-1">Kailas Somase</h2>
            <h2 className="mb-1">Mo.no. +918605386753</h2>
            <h2 className="mb-0">kailassomase12@gmail.com</h2>
            <h2 className="mb-0">near konark nagar,
                                          jatra chowk, adgaon Nashik.</h2>
          </div>
        </div>
        <br/><br/>
      </div>
    </div>
    </div>
  );
};

export default Contact;
